{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/juliauu/customer-insights-from-fitness-tracker-data?scriptVersionId=96011157\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# Customer Insights: Fitness Device Activity Data\n\nThis is a case study part of Google Data Analytics course. \n\n**This is my first ever project and I warmly welcome feedback to improve in the future!**","metadata":{}},{"cell_type":"markdown","source":"\n## **TABLE OF CONTENTS**\n\n1. [PROLOGUE](#10)\n    1. [Purpose](#11)\n    1. [Approach](#12)\n    1. [Summary of findings](#13)\n1. [INSTALL PACKAGES](#20)\n1. [DATA PREPARATION](#30)\n    1. [Load data](#31)\n    1. [Create subset](#32)\n    1. [Data description](#33)\n1. [DATA CLEANING](#40)\n    1. [Duplicates](#41)\n    1. [Empty values](#42)\n    1. [Validation](#43)\n    1. [Column names](#44)\n    1. [Fix datatype](#45)\n    1. [Grouped clean dataset](#46)\n1. [DEFINE AND ASSIGN TRAINER TYPE](#50)\n    1. [Definitions](#51)\n    1. [Assign trainer type](#52)\n1. [INVESTIGATE TRAINER GROUPS](#60)\n    1. [Group sizes](#61)\n    1. [Size comparison](#62)\n    1. [Activity minute distribution](#63)\n1. [CONCLUSIONS AND RECOMMENDATIONS](#70)\n    1. [Limitations](#71)\n    1. [Suggestion for further research](#72)\n  \n    \n\n<a id=\"1\"></a> <br>\n\n## 1 Prologue\n\n<a id=\"11\"></a> <br>\n### Purpose\nThe purpose of this analysis is to help fitness tracker company unleash new growth opportunities and provide content recommendations for their marketing department.\n\n* What is the best marketing content for their target audiences?\n\n<a id=\"12\"></a> <br>\n### Approach\n\nExamine fitness device activity data to evaluate what activities customers track and what is the intensity level of their activities. \n\nAnalysis is done with R because data inspection, cleaning, calculations and visualizations could all be done with it. One graph was prepared in Google Spreadsheets.\n\n**Answers to the following questions are given:**\n1. What trainer types can we identify from the dataset?\n2. How big are these trainer types?\n3. What are their training preferences in terms of training intensity?\n4. Can the dataset reveal a new potential target audience?\n\n\nI used publically open dataset that was upploaded to [Kaggle](https://www.kaggle.com/datasets/arashnic/fitbit) by user [MÃ¶bius](https://www.kaggle.com/arashnic).\n\nThe dataset contains data from 33 fitness tracker users during 12th April - 12th May 2016 (31 days) who consented to the submission of personal tracker data. I use the table called \"daily.Activity_merged.csv\". Access full dataset [here](https://www.kaggle.com/datasets/arashnic/fitbit).\n\n<a id=\"13\"></a> <br>\n### Summary of findings\n\n![activity minutes.JPG](attachment:533dcc2f-e01c-43d1-baab-a1bdd59b8c17.JPG)\n\n* Majority of people in this data set are Hardcore trainers who track activities in Peak Zone heart rate levels\n* New target group identified: No Sporters\n* No Sporters is a segment of people who own a fitness tracker but barely track any sport activities with it\n* This may suggest there are other motivations to get a fitness tracker, not just monitoring sport performance data\n* By understanding why this segment buys fitness devices, the company can target a new audience group\n* Marketing content should be developed keeping in mind the differences in device usage and training intensity\n* Communicate with two tones of voice and two different messages: \n    * Hardcore trainers: highlight advanced sport performance features, visuals with high intentsity sports\n    * No Sporter: highlight wellness tracking features, visuals with low intensity sports or mindfulness\n\n\n\n\n\n\n\n\n\n\n","metadata":{"_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19"},"attachments":{"533dcc2f-e01c-43d1-baab-a1bdd59b8c17.JPG":{"image/jpeg":""}}},{"cell_type":"markdown","source":"<a id=\"20\"></a> <br>\n\n## 2. Install packages\n\nWe need: \n* tidyverse: clean, prepare and visualize data\n* janitor: clean column names\n* lubridate: adjust date configuration\n* scales: scaling our chart\n* skimr: to see statistical summar of our data\n\n","metadata":{}},{"cell_type":"code","source":"#install and load packages\n\ninstall.packages(\"tidyverse\")\ninstall.packages(\"janitor\")\ninstall.packages(\"lubridate\")\ninstall.packages(\"scales\")\ninstall.packages(\"readr\")\ninstall.packages(\"skimr\")\nlibrary(skimr)\nlibrary(tidyverse)\nlibrary(readr)\nlibrary(tidyr)\nlibrary(janitor)\nlibrary(lubridate)\nlibrary(scales)\nlibrary(dplyr)\n","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:38:42.339471Z","iopub.execute_input":"2022-05-19T07:38:42.341845Z","iopub.status.idle":"2022-05-19T07:41:14.869024Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"Installing package into â/usr/local/lib/R/site-libraryâ\n(as âlibâ is unspecified)\n\nInstalling package into â/usr/local/lib/R/site-libraryâ\n(as âlibâ is unspecified)\n\nInstalling package into â/usr/local/lib/R/site-libraryâ\n(as âlibâ is unspecified)\n\nInstalling package into â/usr/local/lib/R/site-libraryâ\n(as âlibâ is unspecified)\n\nInstalling package into â/usr/local/lib/R/site-libraryâ\n(as âlibâ is unspecified)\n\nInstalling package into â/usr/local/lib/R/site-libraryâ\n(as âlibâ is unspecified)\n\nââ \u001b[1mAttaching packages\u001b[22m âââââââââââââââââââââââââââ