001b[24m230.       \u001b[4m1\u001b[24m440\n","output_type":"stream"}]},{"cell_type":"markdown","source":"The summary shows us that there are no empty values. The data type for date is incorrect. We will fix that later. But first, let's validate the activity minutes.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"43\"></a> <br>\n#### c) Validate tracked activity minutes\nFirst, let's validate the data. We want to make sure the recorded daily activity minutes do not exceed 24 hours. We sum up activity minutes and divide them with 60 to get recorded activities in hours.\n\n","metadata":{}},{"cell_type":"code","source":"#validate activity minutes\n\nactivity_df <- mutate(activity_df, total_hours = rowSums(activity_df[3:6])/60)\nsummary(activity_df$total_hours)","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:41:15.692508Z","iopub.execute_input":"2022-05-19T07:41:15.693962Z","iopub.status.idle":"2022-05-19T07:41:15.717788Z"},"trusted":true},"execution_count":6,"outputs":[{"output_type":"display_data","data":{"text/plain":"    Min.  1st Qu.   Median     Mean  3rd Qu.     Max. \n 0.03333 16.49583 24.00000 20.31255 24.00000 24.00000 "},"metadata":{}}]},{"cell_type":"markdown","source":"The summary above shows us that the maximum recorded activity hours in a day is 24. Thus, tracked hours are not exceeding the 24 hours in a day.\nThe minimum value 0,03hours is equivalent to 1minute and 48 seconds. \nI will not exclude days when device is mainly offline because this analysis focuses on understanding how many activity minutes are tracked on 30 day period per user. \nIf device is kept offline, it is informative.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"44\"></a> <br>\n\n#### d) Clean column names \nLet's lowercase and snakecase the column names.","metadata":{}},{"cell_type":"code","source":"#snake case and lowercase column names\n\nactivity <- clean_names(activity_df)\nglimpse(activity)\n","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:41:15.720212Z","iopub.execute_input":"2022-05-19T07:41:15.721662Z","iopub.status.idle":"2022-05-19T07:41:15.798904Z"},"trusted":true},"execution_count":7,"outputs":[{"name":"stdout","text":"Rows: 940\nColumns: 7\n$ id                     \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 1503960366, 1503960366, 1503960366, 1503960366,â¦\n$ activity_date          \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"4/12/2016\", \"4/13/2016\", \"4/14/2016\", \"4/15/20â¦\n$ very_active_minutes    \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 25, 21, 30, 29, 36, 38, 42, 50, 28, 19, 66, 41,â¦\n$ fairly_active_minutes  \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 13, 19, 11, 34, 10, 20, 16, 31, 12, 8, 27, 21, â¦\n$ lightly_active_minutes \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 328, 217, 181, 209, 221, 164, 233, 264, 205, 21â¦\n$ sedentary_minutes      \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 728, 776, 1218, 726, 773, 539, 1149, 775, 818, â¦\n$ total_hours            \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 18.23333, 17.21667, 24.00000, 16.63333, 17.3333â¦\n","output_type":"stream"}]},{"cell_type":"markdown","source":"Original file kept as activity_df, new one created is called activity. Next, let's change the incorrect date.\n\n<a id=\"45\"></a> <br>\n\n#### e) Fix incorrect data type\nLet's change data type for column \"activity_date\" from character to date.","metadata":{}},{"cell_type":"code","source":"#change datatype of activity_date from character to date\n\nactivity$activity_date = as.Date(activity$activity_date,format=\"%m/%d/%Y\") \nsummary(activity)\n","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:41:15.801392Z","iopub.execute_input":"2022-05-19T07:41:15.802855Z","iopub.status.idle":"2022-05-19T07:41:15.839026Z"},"trusted":true},"execution_count":8,"outputs":[{"output_type":"display_data","data":{"text/plain":"       id            activity_date        very_active_minutes\n Min.   :1.504e+09   Min.   :2016-04-12   Min.   :  0.00     \n 1st Qu.:2.320e+09   1st Qu.:2016-04-19   1st Qu.:  0.00     \n Median :4.445e+09   Median :2016-04-26   Median :  4.00     \n Mean   :4.855e+09   Mean   :2016-04-26   Mean   : 21.16     \n 3rd Qu.:6.962e+09   3rd Qu.:2016-05-04   3rd Qu.: 32.00     \n Max.   :8.878e+09   Max.   :2016-05-12   Max.   :210.00     \n fairly_active_minutes lightly_active_minutes sedentary_minutes\n Min.   :  0.00        Min.   :  0.0          Min.   :   0.0   \n 1st Qu.:  0.00        1st Qu.:127.0          1st Qu.: 729.8   \n Median :  6.00        Median :199.0          Median :1057.5   \n Mean   : 13.56        Mean   :192.8          Mean   : 991.2   \n 3rd Qu.: 19.00        3rd Qu.:264.0          3rd Qu.:1229.5   \n Max.   :143.00        Max.   :518.0          Max.   :1440.0   \n  total_hours      \n Min.   : 0.03333  \n 1st Qu.:16.49583  \n Median :24.00000  \n Mean   :20.31255  \n 3rd Qu.:24.00000  \n Max.   :24.00000  "},"metadata":{}}]},{"cell_type":"markdown","source":"Data type is now correct. We can also see that data contains one month of data between 12th April - 12th May 2016. \nFrom this cleaned dataset we create a subset and group observations by id. \n\n\n<a id=\"46\"></a> <br>\n#### f) Group cleaned dataset by user id\nNext, we will aggregate clean dataset by user id. This way we have average activity minutes within a month per user.","metadata":{}},{"cell_type":"code","source":"#group data by id to get average training minutes for each user \n\ngrouped_mean_minutes <- activity %>%\n  group_by(id) %>%\n  summarize(\n    mean_very_active_minutes = mean(very_active_minutes),\n    mean_fairly_active_minutes = mean(fairly_active_minutes),\n    mean_lightly_active_minutes = mean(lightly_active_minutes),\n    mean_sedentary_minutes = mean(sedentary_minutes)\n      ) \nhead(grouped_mean_minutes)\n","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:41:15.841428Z","iopub.execute_input":"2022-05-19T07:41:15.842876Z","iopub.status.idle":"2022-05-19T07:41:15.876542Z"},"trusted":true},"execution_count":9,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 Ã 5</caption>\n<thead>\n\t<tr><th scope=col>id</th><th scope=col>mean_very_active_minutes</th><th scope=col>mean_fairly_active_minutes</th><th scope=col>mean_lightly_active_minutes</th><th scope=col>mean_sedentary_minutes</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>1503960366</td><td>38.7096774</td><td>19.1612903</td><td>219.93548</td><td> 848.1613</td></tr>\n\t<tr><td>1624580081</td><td> 8.6774194</td><td> 5.8064516</td><td>153.48387</td><td>1257.7419</td></tr>\n\t<tr><td>1644430081</td><td> 9.5666667</td><td>21.3666667</td><td>178.46667</td><td>1161.8667</td></tr>\n\t<tr><td>1844505072</td><td> 0.1290323</td><td> 1.2903226</td><td>115.45161</td><td>1206.6129</td></tr>\n\t<tr><td>1927972279</td><td> 1.3225806</td><td> 0.7741935</td><td> 38.58065</td><td>1317.4194</td></tr>\n\t<tr><td>2022484408</td><td>36.2903226</td><td>19.3548387</td><td>257.45161</td><td>1112.5806</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 Ã 5\n\n| id &lt;dbl&gt; | mean_very_active_minutes &lt;dbl&gt; | mean_fairly_active_minutes &lt;dbl&gt; | mean_lightly_active_minutes &lt;dbl&gt; | mean_sedentary_minutes &lt;dbl&gt; |\n|---|---|---|---|---|\n| 1503960366 | 38.7096774 | 19.1612903 | 219.93548 |  848.1613 |\n| 1624580081 |  8.6774194 |  5.8064516 | 153.48387 | 1257.7419 |\n| 1644430081 |  9.5666667 | 21.3666667 | 178.46667 | 1161.8667 |\n| 1844505072 |  0.1290323 |  1.2903226 | 115.45161 | 1206.6129 |\n| 1927972279 |  1.3225806 |  0.7741935 |  38.58065 | 1317.4194 |\n| 2022484408 | 36.2903226 | 19.3548387 | 257.45161 | 1112.5806 |\n\n","text/latex":"A tibble: 6 Ã 5\n\\begin{tabular}{lllll}\n id & mean\\_very\\_active\\_minutes & mean\\_fairly\\_active\\_minutes & mean\\_lightly\\_active\\_minutes & mean\\_sedentary\\_minutes\\\\\n <dbl> & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n\\hline\n\t 1503960366 & 38.7096774 & 19.1612903 & 219.93548 &  848.1613\\\\\n\t 1624580081 &  8.6774194 &  5.8064516 & 153.48387 & 1257.7419\\\\\n\t 1644430081 &  9.5666667 & 21.3666667 & 178.46667 & 1161.8667\\\\\n\t 1844505072 &  0.1290323 &  1.2903226 & 115.45161 & 1206.6129\\\\\n\t 1927972279 &  1.3225806 &  0.7741935 &  38.58065 & 1317.4194\\\\\n\t 2022484408 & 36.2903226 & 19.3548387 & 257.45161 & 1112.5806\\\\\n\\end{tabular}\n","text/plain":"  id         mean_very_active_minutes mean_fairly_active_minutes\n1 1503960366 38.7096774               19.1612903                \n2 1624580081  8.6774194                5.8064516                \n3 1644430081  9.5666667               21.3666667                \n4 1844505072  0.1290323                1.2903226                \n5 1927972279  1.3225806                0.7741935                \n6 2022484408 36.2903226               19.3548387                \n  mean_lightly_active_minutes mean_sedentary_minutes\n1 219.93548                    848.1613             \n2 153.48387                   1257.7419             \n3 178.46667                   1161.8667             \n4 115.45161                   1206.6129             \n5  38.58065                   1317.4194             \n6 257.45161                   1112.5806             "},"metadata":{}}]},{"cell_type":"markdown","source":"Now we have a grouped dataset by user id. We can assign a trainer type for each user.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"50\"></a> <br>\n\n## 5. Define trainer groups and assign each user with a training group\nIn this step we  assign each user with a trainer group based on how they compare with the total averages. \n\n<a id=\"51\"></a> <br>\n#### a) Define training groups\n\nNaming is based on Fitbit definitions, found [here](https://help.fitbit.com/articles/en_US/Help_article/1565.htm) \n\n**Trainer groups are:**\n* **Hardcore trainer:** User with above average Peak Zone minutes\n* **Cardio trainer:**  User with above average Cardio minutes\n* **Fat Burn trainer:** User with above average Fatburn minutes\n* **No sports:** All activity minutes below average\n\nThese Trainer types are going to ba assigned to a user id next.\n","metadata":{}},{"cell_type":"markdown","source":"<a id=\"52\"></a> <br>\n#### b) Assign a trainer group for each user\nThis is done based on their tracked activity minutes. We compare their tracked activity minutes with the total average.","metadata":{}},{"cell_type":"code","source":"#calculate total average activity minutes\n\nmean_very_active <- mean(grouped_mean_minutes$mean_very_active_minutes)\nmean_fairly_active <- mean(grouped_mean_minutes$mean_fairly_active_minutes)\nmean_lightly_active <- mean(grouped_mean_minutes$mean_lightly_active_minutes)\nmean_sedentary <- mean(grouped_mean_minutes$mean_sedentary_minutes)\n\n#create a new column and assign each user a activity group based on how they compare with the average\n\ngrouped_mean_minutes = grouped_mean_minutes %>%\n  mutate(trainer_group = case_when(\n    mean_very_active_minutes >= mean_very_active ~ \"Hardcore trainer\",\n    mean_fairly_active_minutes >= mean_fairly_active ~ \"Cardio trainer\",\n    mean_lightly_active_minutes >= mean_lightly_active ~ \"Fat Burn trainer\",\n    mean_sedentary_minutes >= mean_sedentary ~ \"No sports\",\n    FALSE ~ \"NA\",) \n      )\nhead(grouped_mean_minutes)\n","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:41:15.878961Z","iopub.execute_input":"2022-05-19T07:41:15.880353Z","iopub.status.idle":"2022-05-19T07:41:15.918649Z"},"trusted":true},"execution_count":10,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 Ã 6</caption>\n<thead>\n\t<tr><th scope=col>id</th><th scope=col>mean_very_active_minutes</th><th scope=col>mean_fairly_active_minutes</th><th scope=col>mean_lightly_active_minutes<