utes, fairly_active_minutes, lightly_active_minutes, sedentary_minutes) ~ trainer_group, data=merged_activity, sum) \nView(minutes_per_group)","metadata":{"execution":{"iopub.status.busy":"2022-05-19T07:41:16.463142Z","iopub.execute_input":"2022-05-19T07:41:16.464696Z","iopub.status.idle":"2022-05-19T07:41:16.500938Z"},"trusted":true},"execution_count":13,"outputs":[{"output_type":"display_data","data":{"text/plain":"  trainer_group    very_active_minutes fairly_active_minutes\n1 Cardio trainer    2164               5154                 \n2 Fat Burn trainer  1105                963                 \n3 Hardcore trainer 16120               6101                 \n4 No sports          506                533                 \n  lightly_active_minutes sedentary_minutes\n1 36669                  199181           \n2 58450                  220190           \n3 71133                  321154           \n4 14992                  191213           ","text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 4 Ã 5</caption>\n<thead>\n\t<tr><th scope=col>trainer_group</th><th scope=col>very_active_minutes</th><th scope=col>fairly_active_minutes</th><th scope=col>lightly_active_minutes</th><th scope=col>sedentary_minutes</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Cardio trainer  </td><td> 2164</td><td>5154</td><td>36669</td><td>199181</td></tr>\n\t<tr><td>Fat Burn trainer</td><td> 1105</td><td> 963</td><td>58450</td><td>220190</td></tr>\n\t<tr><td>Hardcore trainer</td><td>16120</td><td>6101</td><td>71133</td><td>321154</td></tr>\n\t<tr><td>No sports       </td><td>  506</td><td> 533</td><td>14992</td><td>191213</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 4 Ã 5\n\n| trainer_group &lt;chr&gt; | very_active_minutes &lt;dbl&gt; | fairly_active_minutes &lt;dbl&gt; | lightly_active_minutes &lt;dbl&gt; | sedentary_minutes &lt;dbl&gt; |\n|---|---|---|---|---|\n| Cardio trainer   |  2164 | 5154 | 36669 | 199181 |\n| Fat Burn trainer |  1105 |  963 | 58450 | 220190 |\n| Hardcore trainer | 16120 | 6101 | 71133 | 321154 |\n| No sports        |   506 |  533 | 14992 | 191213 |\n\n","text/latex":"A data.frame: 4 Ã 5\n\\begin{tabular}{lllll}\n trainer\\_group & very\\_active\\_minutes & fairly\\_active\\_minutes & lightly\\_active\\_minutes & sedentary\\_minutes\\\\\n <chr> & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n\\hline\n\t Cardio trainer   &  2164 & 5154 & 36669 & 199181\\\\\n\t Fat Burn trainer &  1105 &  963 & 58450 & 220190\\\\\n\t Hardcore trainer & 16120 & 6101 & 71133 & 321154\\\\\n\t No sports        &   506 &  533 & 14992 & 191213\\\\\n\\end{tabular}\n"},"metadata":{}}]},{"cell_type":"markdown","source":"Using the minutes_per_group table to for a graph to illustrate how minutes are distributed between trainer types. The chart was done separately in [Google Sheets](https://docs.google.com/spreadsheets/d/1nFCqKoicIjp1cPt7Lt4Y7tAn7Ow-dtwYcoWd11eL4Ts/edit#gid=0).\n\n<a id=\"19\"></a> <br>\n\n#### Distribution of Monthly Active Minutes Per Trainer Type\n\n\n\n\n![activity minutes.JPG](attachment:49a6b72c-a9d3-45ba-805b-c0be43a0f373.JPG)\n","metadata":{},"attachments":{"49a6b72c-a9d3-45ba-805b-c0be43a0f373.JPG":{"image/jpeg":""}}},{"cell_type":"markdown","source":"#### Observations\n\n\n1. Hardcore, Cardio and Fat Burn trainers track roughly the same amount of activity minutes in a month. The intensity differs.\n\n2. No Sports trainer types aren't completely inactive, as they do track some activity minutes. However, the training minutes account for only 8%. As comparison, Hardocre trainers' monthly activity minutes account for 22%.\n\n\n<a id=\"70\"></a> <br>\n\n## 7. Conclusions and recommendations\n\n1. Majority of people in this dataset are Hardcore trainers who track activities in Peak Zone heart rate levels.\n\n2. New potential target group: No Sporters. \n\n3. No Sporters is a segment of people who own a fitness tracker but barely track any sport activities with it. More research is needed to understand this segment, however, this behaviour may suggest there are other motivations to get a fitness tracker, not just monitoring sport performance data. By understanding why this segment buys fitness devices, the company can target a new audience group and open doors for future growth\n\n4. Different variations of marketing content & communication strategy is needed in order to appeal for different fitness tracker users.\n\n3. As No Sporters  track less active minutes, their motivation to buy a fitness tracking device most likely isn't the advanced sport performance features. Instead, they may be more keen of other health features, such as monitoring sleep and stress levels. Therefore promoting advanced wellness tracking features is an affective way of sparking their interest.\n\n4. As majority of No Sporters' training intensity is light, they most likely don't use the advanced sport tracking features. This should be kept in mind when developing the marketing content. If images or video is used, it should contain light intensity training and highlight how the device can improve their sleep quality and help reduce stress in order for them to relate and get interested.\n\n5. Based on Hardcore trainers' training intensity, they are likely open to marketing messages on how the device can help them increase performance and achieve better results. Image and video containing high intensity sports and ads that highlight the advanced sport features of the watch are recommended.\n\n\n<a id=\"71\"></a> <br>\n\n#### a) Limitations\n* As the analysis was done on a small sample on a 31day period, it may contain bias\n* Data did not contain any details on the participants' health status or demographics, which may explain inactivity\n* There is a chance participants were training but it was not tracked with a device\n* Training intensity is subjective and depending on the fitness level of a person\n* Getting data about app usage would be helpful to better understand what types of sports and tracking metrics are preferred\n\n<a id=\"72\"></a> <br>\n\n#### b) Suggestions for further research\n* Analysis should be reproduced again with a larger sample and longer timeframe to see if same pattern still exists\n* Analysis could be reproduced with data from another company to see if similar pattern exists\n* Qualitative research to understand why and how No Sporters use fitness trackers. Once the company understands No Sporters' motivation for having a fitness device, they can target new audienes with effective marketing communication. Perhaps with a new product tailored specifically for No Sporters' needs.\n\n\n\n### Thank you! If you have any feedback, I appreciate if you could share it with me.","metadata":{}}]}